import React from 'react';

let timerForm = (props) => {
    return (
        <div className= "TimerForm">
            <form>
                <label className="Row">
                Work Time:
                </label>
                <input className="Row" 
                    type="number" required
                    name="workTime"
                    value={props.workTime}
                    onChange={props.handleChange}/>
                <label className="Row"> 
                min
                </label>
            </form>            
        </div>
        )
}

export default timerForm;
